import React from 'react';
import NoteItem from './NoteItem';  // Import the NoteItem component

function NoteList({ notes }) {
  return (
    <div className="row">
      {notes.map((note) => (
        <div className="col-md-4 mb-4" key={note.id}>
          <NoteItem note={note} />
        </div>
      ))}
    </div>
  );
}

export default NoteList;
